import React, { Component } from "react";

function Tripinfo(destinationfips) {

    const getPopulation = () => {
        let fips = destinationfips.fips[0].fips
        let state;
        let county;
        if (fips.length < 5){
            state = "0" + fips.slice(0,1)
            county = fips.slice(-3)
        } else {
            state = "0" + fips.slice(0,2)
            county = fips.slice(-3)
        }
        fetch(`https://api.census.gov/data/2019/pep/population?get=COUNTY,DATE_CODE,DATE_DESC,DENSITY,POP,NAME,STATE&DATE_CODE=12&for=county:${county}&in=state:${state}`)
        .then(resp => resp.json())
        .then(data => console.log(data))
    }

    return (
        <div className="trip-info">
            <h1>Hello</h1>
        </div>
    )
}

export default Tripinfo;
